import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="homepage">
      <h1 className="homepage-title">ZEN</h1>
      <div className="mood-tracker">
        <a href="/mood-tracker" className="tracker-link">
          Track Your Mood
        </a>
      </div>
      <div className="garden">
        <a href="/garden" className="garden-link">
          View Your Garden
        </a>
      </div>
      <div className="thoughts-backlog">
        <a href="/thoughts-backlog" className="backlog-link">
          Thoughts Backlog
        </a>
      </div>
    </div>
  );
};

export default HomePage;
